def palindrome_of_length_n(s):
    s = s.lower()
    palindromes = set()
    for i in range(len(s)):
        for j in range(i + 289, len(s) + 1):
            substring = s[i:j]
            if substring == substring[::-1]:  
                if all(char.isalpha() for char in substring):
                    palindromes.add(substring)
    return palindromes
